import { initializeApp } from "firebase/app";
import { getAuth, GoogleAuthProvider } from "firebase/auth";
const firebaseConfig = {
  apiKey: "AIzaSyDJ3WCN656d5z6lP4X5myfrbwdwkszcYH8",
  authDomain: "complete-auth-662de.firebaseapp.com",
  projectId: "complete-auth-662de",
  storageBucket: "complete-auth-662de.firebasestorage.app",
  messagingSenderId: "1014871745273",
  appId: "1:1014871745273:web:3e35768fd6045d0512b828",
  measurementId: "G",
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
const auth = getAuth(app);
const googleProvider = new GoogleAuthProvider();

export { auth, googleProvider };
